import App from "./App";

function ImagePopup() {
  return(
    <section className="popup popup_type_image">
      <div className="popup__const">
        <button className="popup__close popup__close_type_image" type="reset"></button>
        <div>
          <img className="popup__image" />
          <p className="popup__name">Байкал</p>
        </div>
      </div>
    </section>
  )
}
export default ImagePopup;
